import React from 'react';
var r = require('./wallets');

export default class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      wallets: r.wallets()
    };
  }
  render(){
    console.log(this.state.wallets);
    return(
      <h1>this.state.wallets</h1>
    )
  }
}
